import './body.css'
import {Data} from './object.js'

const product=""
export function Body()
{
    return(
        <div className='Body'>
            { Data.map((items)=>(
                    <div className='Container'>
                        <h1>{items.image}</h1>
                        <h1>{items.Title}</h1>
                        <h1>{items.price}</h1>
                        <h1>{items.kg}</h1>
                    </div>
         ))} 
        </div>
    )
}
